Lost Voyage (2001) Horror Mystery Thriller


Twenty five years ago, the SS Corona Queen disappeared in the region known as, &quot;The Bermuda Triangle&quot;. Now, it has returned. Seven people go on board to learn the truth behind her disappearance but the ship did not return alone...



Na 25 jaar duikt een schip op in de Caribbean. Het blijkt een schip te zijn dat als vermist werd opgegeven. Een groep wetenschappers besluit het schip te onderzoeken.


